text:
catherine jane fisher & the 47 governors pilgrimage ;
;
the empowertarian; a person who empowers their own life and the life of others, is a word designed by award winning human rights advocate,artist and author of “i am catherine jane.”
;
;
catherine jane fisher has for the past 18 years, almost two decades has fought with courage to change the status of forces agreement, in hopes to eradicate rape, murder and other heinous crimes by us military since she was raped by a us military serviceman stationed in japan.
;
;
in 2018 june,it was announced that  all 47 governors of japan have agreed that the status of forces agreement should be changed.  therefore fisher has begun the 47 governors pilgrimage. ;
;
her 20 meter #artwork will be displayed in each city.
;
;
the concept of this pilgrimage is to showcase to the world that it is possible to empower lives and the importance of safety as a prevention against crime.  furthermore that it is not acceptable to rape and murder citizens of japan, or worldwide, in accordance with the united nations human rights act, that ‘everyone has the right to life, liberty and security of person.’
;
;
catherine jane fisher was the first woman to break the silence in japan. catherine also became the first woman to win a court case for $1 when her japanese tokyo district court trial victory was endorsed in the courts of milwaukee, wisconsin usa. the $1 was a sacrifice she made for all victims in japan, most especially for okinawa. we are happy to see that more people are coming forward with their stories recently after fisher struggled to pave the way for them even during her illness which was not made public until now.
;
;
support #catherinejanefisher as she meets 47 governors. ;
;
one city. one step at a time. ;
;
;
;
;
